INSERT INTO `tablero_control` VALUES (1, '2019', '01', NULL, 28, '0019', '01', 1, 0.00, 'tablero_20190606034547.pdf', '2019-06-06 15:45:47', '0008', '2019-10-22 17:11:15', '1', '', 'REPORTE DE SITUACIÓN N° 004 – 2019 – COE SALUD – DIGERD', 'EL 13 DE ENERO DE 2019, A LAS 06:00 HORAS APROXIMADAMENTE, SE PRODUJO RUPTURA DEL TUBO COLECTOR Y POSTERIOR ANEGAMIENTO DE AGUAS SERVIDAS EN LA AVENIDA TUSILAGOS A LA ALTURA DE LA CUADRA 12 DE LA AV. PRÓCERES DE LA INDEPENDENCIA, DISTRITO SAN JUAN DE LURIGANCHO.', NULL);
INSERT INTO `tablero_control` VALUES (2, '2019', '01', NULL, 28, '0019', '01', 1, 0.00, 'tablero_20190606035025.pdf', '2019-06-06 15:50:25', '0012', '2019-10-22 11:06:39', '1', '', 'REPORTE DE SITUACIÓN N° 003 (05) - 2019 – COE SALUD - DIGERD', 'EL RALLY DAKAR 2019 SERÁ LA CUADRAGÉSIMA PRIMERA EDICIÓN DE LA CARRERA DE RALLY RAID MÁS EXIGENTE DEL MUNDO. SE REALIZARÁ ENTRE EL 06 Y EL 17 DE ENERO DEL PRESENTE AÑO, POR UNDÉCIMA VEZ CONSECUTIVA EN AMÉRICA DEL SUR, TRAS LA CANCELACIÓN DE LA EDICIÓN DE 2008 EN ÁFRICA POR AMENAZAS TERRORISTAS Y POR PRIMERA VEZ EN UN SOLO PAÍS EL CUAL ES EL PERÚ. LA SALIDA Y FINAL DE LA COMPETENCIA SERÁ LA CIUDAD DE LIMA Y SE DISPUTARÁ EN 10 ETAPAS.', NULL);
