INSERT INTO `tablero_control` VALUES (279, '2019', '01', NULL, 28, '0008', '01', 1, 0.00, 'tablero_20191025040411.pdf', '2019-10-25 16:04:11', '0008', '2019-10-25 17:12:04', '1', '', 'REPORTE DE SITUACIÓN N° 002 – 2019 – COE SALUD – DIGERD', 'El Rally Dakar 2019 será la cuadragésima primera edición de la carrera de rally raid más exigente del mundo. Se realizará entre el 06 y el 17 de enero del presente año, por undécima vez consecutiva en América del Sur, tras la cancelación de la edición de 2008 en África por amenazas terroristas y por primera vez en un solo país el cual es el Perú. La salida y final de la competencia será la ciudad de Lima y se disputará en 10 etapas.', NULL);
INSERT INTO `tablero_control` VALUES (280, '2019', '01', NULL, 28, '0008', '07', 1, 0.00, 'tablero_20191025040818.pdf', '2019-10-25 16:08:18', '0008', '2019-10-25 17:19:05', '1', '', 'REPORTE DE EVENTO N° 1606 - 2019 - COE SALUD - DIGERD', 'POR MOTIVO DEL 198 ANIVERSARIO DE LA INDEPENDENCIA DEL PERÚ, EL 29 DE JULIO DE TODOS LOS AÑOS SE REALIZA LA PARADA MILITAR EN LA AV.BRASIL.', NULL);
INSERT INTO `tablero_control` VALUES (281, '2019', '01', NULL, 28, '0008', '08', 1, 0.00, 'tablero_20191025041136.pdf', '2019-10-25 16:11:36', '0008', '2019-10-25 17:12:45', '1', '', 'REPORTE DE SITUACIÓN N°057– 2019 – COE SALUD – DIGERD', 'El 15 de agosto de 2019 a las 15:00 horas, se registró un movimiento sísmico de magnitud 8.5, referencia 90 km con profundidad de 35 Km, referencia 90 km al Oeste del litoral, referencia mar.', NULL);
INSERT INTO `tablero_control` VALUES (282, '2019', '01', NULL, 28, '0008', '08', 1, 0.00, 'tablero_20191025041913.pdf', '2019-10-25 16:19:13', '0008', '2019-10-25 17:13:01', '1', '', 'REPORTE DE EVENTO N° 1504 - 2019 - COE SALUD - DIGERD', 'XVIII JUEGOS PANAMERICANOS Y PARAPANAMERICANOS- LIMA 2019. EL MINISTERIO DE SALUD DESPLEGÓ 10 PMA E IMPLEMENTÓ Y DOTÓ DE PERSONAL A 6 TÓPICOS, ADEMÁS SE MOVILIZAN AMBULANCIAS HOSPITALARIAS, SAMU Y DE OTRAS ENTIDADES PARA MANTENER LA COBERTURA EN SALUD DE TODA LA POBLACIÓN QUE ACUDA A LAS DIFERENTES SEDES DONDE SE REALIZARÁN LAS COMPETENCIAS.', NULL);
