INSERT INTO `tablero_indicador` VALUES (21, '2021', 'RECTORÍA PARA EL USO EFICIENTE DE LA ESTRATEGIA PRESUPUESTAL DE GESTIÓN DEL RIESGO FRENTE A EMERGENCIAS MASIVAS Y DESASTRES EN SALUD', 2, 'Gasto eficiente en más del 80% del pp068 de las unidades ejecutoras/Gsto del Programa Presupuestal 0', 'Es un indicador de rectoría en la ejecución presupuestal del PP068', 'Es un indicador de proceso en la gestión presupuestal del Programa Presupuestal 068 frente a emergencias masivas y desastres', NULL, '1');
INSERT INTO `tablero_indicador` VALUES (22, '2021', 'CENTRO DE OPERACIONES DE EMERGENCIA DEL SECTOR SALUD Y ESPACIOS DE MONITOREO DE EMERGENCIAS Y DESASTRES A NIVEL NACIONAL   EFICIENTES EN LA GESTIÓN OPORTUNA DE INFORMACIÓN', 2, 'Reportes de  COE salud por el SIREED (Sistema de Registro de eventos de emergencias y desastres del', 'Rectoría del MINSA en la administración y gestión de las emergencias y desastres', 'Es un indicador de proceso en la gestión y administración de las emergencias masivas y los desastres a nivel nacional que permite ejercer la rectoría del MINSA. Es un indicador de eficiencia y de oportunidad de intervención. El reporte constituye parte de la evaluación de daños y análisis de necesidades (EDAN) en el sector salud. El punto de corte a nivel de regiones  aceptable es reporte dentro de las 6 horas de ocurrido un evento, sin embargo la meta a mediano plazo es lograr reporte dentro de las 2 horas a nivel nacional por cualquier medio de reporte via software (app), teléfono o con radiocomunicaciones con sistema alterno', NULL, '1');
INSERT INTO `tablero_indicador` VALUES (23, '2021', 'RESPUESTA OPORTUNA EN LA REDUCCIÓN DE DAÑOS A LA SALUD FÍSICA O MENTAL FRENTE A EMERGENCIAS MASIVAS O DESASTRES', 2, 'N° de emergencias y desastres con movilización de brigadas y/o EMTs /N° de emergencias y desastres r', '', 'Es un indicador de resultado, eficiencia  y de rectoría del  MINSA dado que consolida información de la respuesta de Brigadas, EMT o células especializadas frente a emergencias masivas y desastres', NULL, '1');
