DROP VIEW IF EXISTS `lista_articulos_ubicacion`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `lista_articulos_ubicacion` AS select max(`lista`.`idoperacion`) AS `IdOperacion`,`lista`.`idarticuloregistro` AS `IdInventario`,`inventario`.`IdArticulo` AS `IdArticulo`,`inventario`.`SIGA` AS `SIGA`,`inventario`.`Descripcion` AS `Descripcion`,`inventario`.`Marca` AS `Marca`,`inventario`.`Modelo` AS `Modelo`,`inventario`.`Serie` AS `Serie`,`inventario`.`Clasificacion` AS `Clasificacion`,`inventario`.`Barra01` AS `Barra01`,`inventario`.`Barra02` AS `Barra02`,`inventario`.`SBN` AS `SBN`,`inventario`.`Clasificador` AS `Clasificador`,`inventario`.`Condicion` AS `Condicion`,`lista`.`ubigeo` AS `Ubigeo`,`lista`.`coordenadas` AS `Coordenadas`,`region`.`Codigo_Departamento` AS `Codigo_Departamento`,`region`.`Nombre` AS `Region`,`provincia`.`Codigo_Provincia` AS `Codigo_Provincia`,`provincia`.`Nombre` AS `Provincia`,`distrito`.`Codigo_Distrito` AS `Codigo_Distrito`,`distrito`.`Nombre` AS `Distrito` from ((((`lista_articulos_ubicacion_pre` `lista` join `ubigeo` `region` on(((`region`.`Codigo_Departamento` = ifnull(left(`lista`.`ubigeo`,2),'00')) and (`region`.`Codigo_Provincia` = '00') and (`region`.`Codigo_Distrito` = '00')))) join `ubigeo` `provincia` on(((`provincia`.`Codigo_Departamento` = ifnull(left(`lista`.`ubigeo`,2),'00')) and (`provincia`.`Codigo_Provincia` = ifnull(substr(`lista`.`ubigeo`,3,2),'00')) and (`provincia`.`Codigo_Distrito` = '00')))) join `ubigeo` `distrito` on(((`distrito`.`Codigo_Departamento` = ifnull(left(`lista`.`ubigeo`,2),'00')) and (`distrito`.`Codigo_Provincia` = ifnull(substr(`lista`.`ubigeo`,3,2),'00')) and (`distrito`.`Codigo_Distrito` = ifnull(right(`lista`.`ubigeo`,2),'00'))))) join `lista_articulos_inventariados` `inventario` on((`inventario`.`IdInventario` = `lista`.`idarticuloregistro`))) where (`lista`.`estado` = '1') group by `lista`.`idarticuloregistro`;

