hen (`evento_ficha_atencion_detalle`.`Evento_Ficha_Atencion_Detalle_Clasificacion` = '4') then '0 - Fallecido' end) AS `Clasificacion`,`evento_ficha_atencion_detalle`.`Evento_Ficha_Atencion_Detalle_Inicio_Sintomas` AS `Evento_Ficha_Atencion_Detalle_Inicio_Sintomas`,`evento_ficha_atencion_detalle`.`Evento_Ficha_Atencion_Detalle_Diagnostico` AS `Evento_Ficha_Atencion_Detalle_Diagnostico`,`evento_ficha_atencion_detalle`.`Evento_Ficha_Atencion_Detalle_CIE10_Codigo` AS `CIE10`,`lista_enfermedades`.`Descripcion` AS `CIE10_Descripcion`,`evento_ficha_atencion_detalle`.`Evento_Ficha_Atencion_Detalle_Hora_Atencion` AS `Evento_Ficha_Atencion_Detalle_Hora_Atencion`,`evento_tipo_entidad_atencion`.`Evento_Tipo_Entidad_Atencion_Nombre` AS `Evento_Tipo_Entidad_Atencion_Nombre`,`evento_tipo_entidad_atencion_oferta_movil`.`Evento_Tipo_Entidad_Atencion_Oferta_Movil_Nombre` AS `Evento_Tipo_Entidad_Atencion_Oferta_Movil_Nombre`,`evento_ficha_atencion_detalle`.`Evento_Ficha_Atencion_Detalle_Vacuna` AS `Evento_Ficha_Atencion_Detalle_Vacuna`,`evento_ficha_atencion_detalle`.`Evento_Ficha_Atencion_Detalle_Quimioprofilaxis` AS `Evento_Ficha_Atencion_Detalle_Quimioprofilaxis`,`evento_ficha_atencion_detalle`.`Evento_Ficha_Atencion_Detalle_Medicamentos` AS `Evento_Ficha_Atencion_Detalle_Medicamentos`,(case when (`evento_ficha_atencion_detalle`.`Evento_Ficha_Atencion_Detalle_Destino` = '1') then 'Alta' when (`evento_ficha_atencion_detalle`.`Evento_Ficha_Atencion_Detalle_Destino` = '2') then 'Referido' end) AS `Destino`,`evento_ficha_atencion_detalle`.`Evento_Ficha_Atencion_Detalle_Lugar_Traslado` AS `Evento_Ficha_Atencion_Detalle_Lugar_Traslado`,`evento_ficha_atencion_detalle`.`Evento_Ficha_Atencion_Detalle_Responsable` AS `Evento_Ficha_Atencion_Detalle_Responsable` from ((((`evento_ficha_atencion` join `evento_ficha_atencion_detalle` on((`evento_ficha_atencion`.`Evento_Ficha_Atencion_ID` = `evento_ficha_atencion_detalle`.`Evento_Ficha_Atencion_ID`))) join `evento_tipo_entidad_atencion_oferta_movil` on((`evento_ficha_atencion_detalle`.`Evento_Tipo_Entidad_Atencion_Oferta_Movil_ID` = `evento_tipo_entidad_atencion_oferta_movil`.`Evento_Tipo_Entidad_Atencion_Oferta_Movil_ID`))) join `evento_tipo_entidad_atencion` on((`evento_tipo_entidad_atencion_oferta_movil`.`Evento_Tipo_Entidad_Atencion_ID` = `evento_tipo_entidad_atencion`.`Evento_Tipo_Entidad_Atencion_ID`))) join `lista_enfermedades` on((`evento_ficha_atencion_detalle`.`Evento_Ficha_Atencion_Detalle_CIE10_Codigo` = `lista_enfermedades`.`Codigo`)));

