CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `lista_historiales_paciente` AS select `covid_paciente_historial`.`id_historial` AS `id_historial`,`covid_paciente_historial`.`id_paciente` AS `id_paciente`,date_format(`covid_paciente_historial`.`fecha`,'%d/%m/%Y') AS `Fecha`,if((`covid_paciente_historial`.`positivo` = '0'),'--','SI') AS `P`,if((`covid_paciente_historial`.`sospechoso` = '0'),'--','SI') AS `S`,if((`covid_paciente_historial`.`negativo` = '0'),'--','SI') AS `N`,date_format(`covid_paciente_historial`.`fecha_muestra`,'%d/%m/%Y') AS `F_Muestra`,concat_ws(' - ',`covid_paciente_historial`.`cie_10_1_descripcion`,`covid_paciente_historial`.`cie_10_2_descripcion`,`covid_paciente_historial`.`cie_10_3_descripcion`) AS `Diagnosticos`,if((`covid_paciente_historial`.`sala_con_oxigeno` = '0'),'--','SI') AS `SCO2`,if((`covid_paciente_historial`.`sala_sin_oxigeno` = '0'),'--','SI') AS `SSO2`,if((`covid_paciente_historial`.`uci_con_ventilacion` = '0'),'--','SI') AS `UCICVM`,if((`covid_paciente_historial`.`uci_sin_ventilacion` = '0'),'--','SI') AS `UCISVM`,if((`covid_paciente_historial`.`favorable` = '0'),'--','SI') AS `Favorable`,if((`covid_paciente_historial`.`desfavorable` = '0'),'--','SI') AS `Desfavorable`,if((`covid_paciente_historial`.`fallecido` = '0'),'--','SI') AS `Fallecido`,if((`covid_paciente_historial`.`alta` = '0'),'--','SI') AS `Alta` from `covid_paciente_historial`;

