-- View structure for lista_ingresos_detalle_ubicacion
-- ----------------------------
DROP VIEW IF EXISTS `lista_ingresos_detalle_ubicacion`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `lista_ingresos_detalle_ubicacion` AS select `ingreso`.`idingreso` AS `ID`,`ingreso`.`anio_ejecucion` AS `Anio`,right(concat('0000',`ingreso`.`numero_guia`),4) AS `Guia`,date_format(`ingreso`.`fecha_emision`,'%d/%m/%Y') AS `Fecha_Guia`,`ingreso`.`idalmacen` AS `IdAlmacen`,`almacen`.`nombre` AS `Almacen`,ifnull(`almacen`.`ubigeo`,'000000') AS `Ubigeo`,ifnull(left(`almacen`.`ubigeo`,2),'00') AS `Codigo_Region`,`region`.`Nombre` AS `Region`,ifnull(substr(`almacen`.`ubigeo`,3,2),'00') AS `Codigo_Provincia`,`provincia`.`Nombre` AS `Provincia`,ifnull(right(`almacen`.`ubigeo`,2),'00') AS `Codigo_Distrito`,`distrito`.`Nombre` AS `Distrito`,ifnull(date_format(`ingreso`.`fecha_ingreso`,'%d/%m/%Y'),'00/00/0000') AS `Fecha_Ingreso`,(case `ingreso`.`estado` when '1' then 'Activo' when '0' then 'Inactivo' end) AS `Estado`,`detalle`.`iddetalle` AS `IDD`,`detalle`.`idingreso` AS `IdIngreso`,`lista`.`IdInventario` AS `IdInventario`,`lista`.`SIGA` AS `SIGA`,`lista`.`Descripcion` AS `Descripcion`,`lista`.`Marca` AS `Marca`,`lista`.`Modelo` AS `Modelo`,`lista`.`Serie` AS `Serie`,`lista`.`Clasificacion` AS `Clasificacion`,`lista`.`Barra01` AS `Barra01`,`lista`.`Barra02` AS `Barra02`,`lista`.`SBN` AS `SBN`,`lista`.`Clasificador` AS `Clasificador`,`lista`.`Condicion` AS `Condicion`,`detalle`.`unidad` AS `Cantidad` from ((((((`inventarios_guia_ingreso_detalle` `detalle` join `lista_articulos_inventariados` `lista` on((`lista`.`IdInventario` = `detalle`.`idarticuloregistro`))) join `inventarios_guia_ingreso` `ingreso` on((`ingreso`.`idingreso` = `detalle`.`idingreso`))) join `inventarios_almacen` `almacen` on((`almacen`.`idalmacen` = `ingreso`.`idalmacen`))) join `ubigeo` `region` on(((`region`.`Codigo_Departamento` = ifnull(left(`almacen`.`ubigeo`,2),'00')) and (`region`.`Codigo_Provincia` = '00') and (`region`.`Codigo_Distrito` = '00')))) join `ubigeo` `provincia` on(((`provincia`.`Codigo_Departamento` = ifnull(left(`almacen`.`ubigeo`,2),'00')) and (`provincia`.`Codigo_Provincia` = ifnull(substr(`almacen`.`ubigeo`,3,2),'00')) and (`provincia`.`Codigo_Distrito` = '00')))) join `ubigeo` `distrito` on(((`distrito`.`Codigo_Departamento` = ifnull(left(`almacen`.`ubigeo`,2),'00')) and (`distrito`.`Codigo_Provincia` = ifnull(substr(`almacen`.`ubigeo`,3,2),'00')) and (`distrito`.`Codigo_Distrito` = ifnull(right(`almacen`.`ubigeo`,2),'00')))));

