CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `lista_salidas_detalle_ubicacion` AS select `salida`.`idsalida` AS `ID`,`salida`.`anio_ejecucion` AS `Anio`,right(concat('0000',`salida`.`numero_guia`),4) AS `Guia`,date_format(`salida`.`fecha_emision`,'%d/%m/%Y') AS `Fecha_Guia`,'0' AS `IdAlmacen`,'[N/A]' AS `Almacen`,ifnull(`salida`.`ubigeo_sireed`,'000000') AS `Ubigeo`,ifnull(left(`salida`.`ubigeo_sireed`,2),'00') AS `Codigo_Region`,`region`.`Nombre` AS `Region`,ifnull(substr(`salida`.`ubigeo_sireed`,3,2),'00') AS `Codigo_Provincia`,`provincia`.`Nombre` AS `Provincia`,ifnull(right(`salida`.`ubigeo_sireed`,2),'00') AS `Codigo_Distrito`,`distrito`.`Nombre` AS `Distrito`,ifnull(date_format(`salida`.`fecha_salida`,'%d/%m/%Y'),'00/00/0000') AS `Fecha_Salida`,(case `salida`.`estado` when '1' then 'Activo' when '0' then 'Inactivo' end) AS `Estado`,`detalle`.`iddetalle` AS `IDD`,`detalle`.`idsalida` AS `IdSalida`,`lista`.`IdInventario` AS `IdInventario`,`lista`.`SIGA` AS `SIGA`,`lista`.`Descripcion` AS `Descripcion`,`lista`.`Marca` AS `Marca`,`lista`.`Modelo` AS `Modelo`,`lista`.`Serie` AS `Serie`,`lista`.`Clasificacion` AS `Clasificacion`,`lista`.`Barra01` AS `Barra01`,`lista`.`Barra02` AS `Barra02`,`lista`.`SBN` AS `SBN`,`lista`.`Clasificador` AS `Clasificador`,`lista`.`Condicion` AS `Condicion`,`detalle`.`unidad` AS `Cantidad` from (((((`inventarios_guia_salida_detalle` `detalle` join `lista_articulos_inventariados` `lista` on((`lista`.`IdInventario` = `detalle`.`idarticuloregistro`))) join `inventarios_guia_salida` `salida` on((`salida`.`idsalida` = `detalle`.`idsalida`))) join `ubigeo` `region` on(((`region`.`Codigo_Departamento` = ifnull(left(`salida`.`ubigeo_sireed`,2),'00')) and (`region`.`Codigo_Provincia` = '00') and (`region`.`Codigo_Distrito` = '00')))) join `ubigeo` `provincia` on(((`provincia`.`Codigo_Departamento` = ifnull(left(`salida`.`ubigeo_sireed`,2),'00')) and (`provincia`.`Codigo_Provincia` = ifnull(substr(`salida`.`ubigeo_sireed`,3,2),'00')) and (`provincia`.`Codigo_Distrito` = '00')))) join `ubigeo` `distrito` on(((`distrito`.`Codigo_Departamento` = ifnull(left(`salida`.`ubigeo_sireed`,2),'00')) and (`distrito`.`Codigo_Provincia` = ifnull(substr(`salida`.`ubigeo_sireed`,3,2),'00')) and (`distrito`.`Codigo_Distrito` = ifnull(right(`salida`.`ubigeo_sireed`,2),'00')))));

